import './style.css';
import CardInfo from '../cardInfo/index';
import CardOthers from '../cardOthers/index';
import CardCategory from '../cardCategory/index';

export default function ProjetoPagina() {
    return (
    <div className="projeto-conteudo-container">
    <CardCategory />
    <CardInfo />
    <CardOthers />
    </div>           
     
        
    );
}
